import { Component } from '@angular/core';

@Component({
  selector: 'app-calendar-container',
  templateUrl: './calendar-container.component.html',
  styleUrls: ['./calendar-container.component.css']
})
export class CalendarContainerComponent {

  title: string = "Agendamentos";

}
<div class="__cointainer__calendar shadow-sm">
  <div class="container">
    <div class="row">
      <div class="col-xs-12 col-sm-12 col-md-12">

        <!-- Tile -->
        <app-title-component [title]="title"></app-title-component>

      </div>
    </div>
  </div>
</div>

<!-- Events Header -->
<app-event-header></app-event-header>

<!-- Events -->
<app-event-component></app-event-component>
